import React from 'react';
import s from '../styles/Navbar.module.css';

const Navbar = () => {
	return (
		<nav className={s.nav}>
			<div className={classes.item}>
				<a>Profile</a>
			</div>
			<div className={classes.item}>
				<a>Messages</a>
			</div>
			<div className={classes.item}>
				<a>News</a>
			</div>
			<div className={classes.item}>
				<a>Music</a>
			</div>
			<div className={s.item}>
				<a>Settings</a>
			</div>
		</nav>
	);
};

export default Navbar;
